import React, { Fragment } from "react";
import { Link } from 'react-router-dom';


export const Header = () => {

  return (
    <Fragment>
      <ul>
        <li><Link to='/'>Home</Link></li>
        <li><Link to='/user/:id'>User</Link></li>
      </ul>
    </Fragment>
  )
}
